widgets_values:
* {
    font-family: 'Arial', sans-serif; /* 使用Arial字体，并设置备用字体 */
    color: #ff69b4; /* 全局字体颜色设置为粉色 */
    font-weight: bold; /* 全局字体加粗 */
}

body {
    background-color: #800080; /* 设置紫色背景 */
}

.startPage {
    position: absolute;
    width: auto;
    z-index: 0;
    transition: transform 0.3s ease;
}

.startPage:hover {
    transform: translateY(-5px); /* 鼠标悬停时轻微上移 */
}

.hoverContainer {
    background: #800080; /* 紫色背景 */
    border-radius: 27px;
    padding: 50px;
    display: flex;
    flex-direction: row;
    margin: 12px auto;
    position: relative;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2); /* 添加阴影以增加层次感 */
}

.size-smallButton {
    font-size: 24px; /* 调整字体大小 */
    border-radius: 12px;
    height: 48px;
    min-width: 48px;
    display: flex;
    align-items: center;
    justify-content: center;
    width: auto;
    cursor: pointer;
    border: 2px solid #ff69b4; /* 粉色边框 */
    background-color: #800080; /* 紫色背景 */
    transition: all 0.3s ease; /* 过渡效果 */
    margin: 0 10px; /* 增加间距 */
}

.size-smallButton:hover {
    background-color: #ff69b4; /* 鼠标悬停时粉色背景 */
    color: #800080; /* 紫色文字 */
}

.style-input {
    background: #800080; /* 紫色背景 */
    padding: 12px;
    border: 2px solid #ff69b4; /* 粉色边框 */
    transition: all 0.3s ease; /* 过渡效果 */
}

.style-input:hover {
    border-color: #c080ff; /* 鼠标悬停时边框颜色 */
}

a:not(:first-child) {
    margin-left: 8px;
}

a {
    color: #ff69b4; /* 粉色链接颜色 */
    text-decoration: none; /* 去除下划线 */
    transition: color 0.3s; /* 过渡效果 */
}

a:hover,
a:hover .header_discrip {
    color: #c080ff !important; /* 鼠标悬停时更深的粉色 */
}
